import React, { useEffect, useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { API_BASE } from '../config/config';
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

function RichiesteMie() {
  const [richieste, setRichieste] = useState([]);
  const [errore, setErrore] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (!token) {
      setErrore('Token mancante');
      return;
    }

    fetch(`${API_BASE}/api/richieste/mie`, {
      headers: { Authorization: `Bearer ${token}` }
    })
      .then(res => res.json())
      .then(data => {
        if (Array.isArray(data)) {
          setRichieste(data);
        } else {
          setErrore(data.error || 'Errore inatteso dal server');
        }
      })
      .catch(err => {
        console.error('Errore connessione:', err);
        setErrore('Errore di connessione al server');
      });
  }, []);

  const handleDelete = async (id) => {
    if (!window.confirm('Sei sicuro di voler eliminare questa richiesta?')) return;
    const token = localStorage.getItem('token');
    try {
      const res = await fetch(`${API_BASE}/api/richiesta/${id}`, {
        method: 'DELETE',
        headers: { Authorization: `Bearer ${token}` }
      });
      if (res.ok) {
        setRichieste(prev => prev.filter(r => r.id !== id));
        toast.success('✅ Richiesta eliminata con successo');
      } else {
        toast.error('❌ Errore durante l\'eliminazione');
      }
    } catch (err) {
      console.error(err);
      toast.error('❌ Errore di connessione');
    }
  };

  return (
    <div style={{ padding: '1rem' }}>
      <h2>📋 Le tue richieste</h2>

      {errore && <p style={{ color: 'red' }}>⚠️ {errore}</p>}

      {richieste.length === 0 && !errore ? (
        <p>Non hai ancora inserito richieste.</p>
      ) : (
        <ul>
          {richieste.map(r => (
            <li key={r.id} style={{ marginBottom: '1rem', borderBottom: '1px solid #ccc', paddingBottom: '1rem' }}>
              <p><strong>Categoria:</strong> {r.categoria}</p>
              <p><strong>Regione:</strong> {r.regione}</p>
              <p><strong>Provincia:</strong> {r.provincia}</p>
              <p><strong>Comune:</strong> {r.localita}</p>
              <p><strong>Urgenza:</strong> {r.urgente ? 'Sì' : 'No'}</p>
              <p><strong>Contatti:</strong> {r.contatti || '-'}</p>
              <p><strong>Data:</strong> {new Date(r.data_inserimento).toLocaleDateString()}</p>
              <button onClick={() => navigate(`/modifica-richiesta/${r.id}`)} style={{ marginRight: '1rem' }}>✏️ Modifica</button>
              <button onClick={() => handleDelete(r.id)}>🗑️ Elimina</button>
            </li>
          ))}
        </ul>
      )}

      <Link to="/nuova-richiesta">➕ Inserisci nuova richiesta</Link>
      <ToastContainer position="top-center" autoClose={3000} />
    </div>
  );
}

export default RichiesteMie;
